{"reasoning":"Ground truth focuses on the helicopter being in flight even though its rotor blades are not turning; the presence of a character underneath is secondary context. The key symptom is the motionless rotor while the helicopter still flies. 

Generated report instead focuses on an NPC floating below the helicopter with no visible attachment. It does not mention the rotor blades at all. The core problem it highlights is a missing attachment/animation for the NPC, not the helicopter’s rotor state.

Because the two descriptions point to different primary symptoms and likely different underlying systems (rotor animation vs. character attachment), they do not describe the same bug.","match":false}

{"reasoning":"Ground truth: Player can penetrate a building’s collision, which makes the camera go inside the wall and shows the empty void behind it – a classic "player-clipping-through-geometry" problem (collision too thin / missing on a building wall). 

Generated report: Mentions two issues, neither of which matches that specific problem. Issue (1) is just a non-interactive door (nothing about clipping or void). Issue (2) says large sections of the construction area do not render at all; the player falls through the world or hits invisible walls – this is about missing geometry/rendering rather than the player forcing their way into an existing wall and causing camera clipping. Although both descriptions contain the word “void,” the generated report attributes it to entire environment sections not loading, not to the player clipping into a solid building. The symptom, context and cause are different.

Therefore the generated report does not describe the same underlying bug.","match":false}

{"reasoning":"The ground truth bug is that a character shows a swimming animation while not in water ("swimming in the air").

The generated report describes the character being in a swimming-like pose while moving across solid ground (i.e., not in water) instead of the normal walk/run animation. This is the same core symptom: the swimming animation is triggered when it shouldn’t be. The extra detail about incorrect vehicle UI does not contradict the ground truth and still centers on the same animation glitch.

Therefore, both reports refer to the same underlying bug.","match":true}

{"reasoning":"Ground-truth bug concerns a downed wrestler whose hand intersects (clips) with their own body while the whole body jitters/shakes rapidly. The key points are clipping and rapid shaking while the wrestler is on the mat.

Generated report describes a completely different symptom: after a submission the wrestler remains in a rolling animation loop and never transitions to an idle/defeated pose. There is no mention of body part clipping into another body part or of a jittering/shaking problem; instead it is an animation-state lock that causes continuous rolling.

Because the primary behaviors are different (clipping + shaking vs stuck-rolling animation) and occur under different conditions, they are very likely separate bugs.","match":false}

{"reasoning":"Ground truth bug: an NPC continually bounces/moves up and down in the background – the key symptom is constant vertical oscillation (a jittering or bouncing motion).

Generated report: NPC becomes stuck floating above a bridge during a cut-scene; the model is described as "stuck in mid-air" in an "unnatural pose" and does not move or walk away. The emphasis is on the NPC being frozen/hanging in place, not on repeated bouncing or vertical oscillation.

Although both issues involve an NPC positioned incorrectly in the air, the specific observed behavior is different: one is a continuous bouncing motion, the other is a stationary floating pose. These are likely distinct bugs with different manifestations and possibly different causes (animation jitter vs. failure to update position at all). Therefore they should not be considered the same underlying issue.","match":false}
